INSERT INTO `data_concepts` VALUES (1,NULL,'BioRails',1,'This is the main <strong>context </strong>or<strong> conceptual name space </strong>for all key <strong>concepts </strong>in the core BioRails application. The context is divided into a logical tree of concepts.&nbsp; These concepts can be extended with child concepts providing&nbsp; the possibility of <strong>value lookup lists</strong> defined against each concept. In-use concepts<strong> </strong>are linked to <strong>parameter types </strong>at the global catalogue level. Parameter types are then implemented as <strong>study parameters</strong> and a linked lookup <strong>element </strong>may be used.<br />\r\n<br />\r\nThis structure provides a solid division of control between global warehousing need and local terminology, put more simply, the scientists can maintain their own (often unique) terminologies which can be mapped into the corporate dictionaries.',NULL,3,'sys','2007-01-22 15:23:29','sys','2007-01-23 20:54:17','DataContext'),(2,1,'Subject',1,'Subject',NULL,1,'sys','2006-09-06 19:33:33','sys','2006-09-06 19:33:33','DataConcept'),(3,1,'Study',1,'Study',NULL,1,'sys','2006-09-06 19:35:22','sys','2006-09-06 19:35:22','DataConcept'),(4,2,'Compound',1,'Compound Inventory',NULL,5,'sys','2006-09-06 19:35:33','sys','2006-10-09 16:01:50','DataConcept'),(5,2,'Batch',1,'Batch',NULL,1,'sys','2006-09-06 19:35:43','sys','2006-09-06 19:35:43','DataConcept'),(6,2,'Sample',1,'Sample',NULL,1,'sys','2006-09-06 19:35:50','sys','2006-09-06 19:35:51','DataConcept'),(7,2,'Container',1,'Container',NULL,2,'sys','2006-09-06 19:36:00','sys','2007-01-19 15:37:11','DataConcept'),(8,7,'Plate',1,'Plate',NULL,1,'sys','2006-09-06 19:36:07','sys','2006-09-06 19:36:07','DataConcept'),(9,7,'Rack',1,'Rack',NULL,1,'sys','2006-09-06 19:36:13','sys','2006-09-06 19:36:13','DataConcept'),(10,7,'Tube',1,'Tube',NULL,1,'sys','2006-09-06 19:36:24','sys','2006-09-06 19:36:24','DataConcept'),(11,7,'Tray',1,'Tray',NULL,2,'sys','2006-09-06 19:36